webpackJsonp([0x688361862fc9],{795:function(e,o){e.exports={data:{markdownRemark:{html:'<blockquote>\n<p>Gensokyo was the world of dreams a single girl sees.\nIn the dream, she was “Reimu” of the main character of Gensokyo.\nAnd the dream will come to an end someday.\nThis story is the story after Gensokyo has terminated.</p>\n<p>“Rein”: She is a ordinary school girl who saw a dream as Marisa by miracle of Youkai.\nAsking for a eden that she forgot once, she will overcome school life, various happening in private life, and encounter.\nAnd finally, she will meet again the girl of the Lord of the dream.</p>\n</blockquote>\n<p>It is a spin-off story of my touhou fangame: “<a href="../c/concealed-the-conclusion.md">Touhou Concealed the Conclusion</a>”.\nNovel set in the real world after Gensokyo disappeared. All 112 pages.</p>\n<p><a href="https://bookwalker.jp/debe42447a-e129-415a-8d46-a6873232200b/">You can download from BOOK☆WALKER</a>!</p>\n<p>Illustration: <a href="http://pixiv.me/mutsuki_nozomi">Hiro</a></p>',frontmatter:{cover:null,date:"2016-12-28T00:14:40+09:00",strDate:"2016/12/27",redirect:null,tags:["novel","touhou"],title:"Answer the Conclusion",youtube:"NmR9EevRMJc"}},site:{siteMetadata:{langKeyDefault:"ja",langs:["ja","en"]}}},pathContext:{path:"/en/p/a/answer-the-conclusion/",langKey:"en"}}}});
